import React from "react";

const Blogs = () => {
  return (
    <section className="blogs section" id="blogs">
      <h2 className="section_title">Blogs</h2>
      <span className="section_subtitle">My blogs</span>
      <div className="blogs_container container grid">
        <div className="blogs_content grid">
          <a href="#" className="blogs_button">
            View More{" "}
            <i className="uil uil-arrow-right blogs_button-icon"></i>
          </a>
        </div>
      </div>
    </section>
  );
};

export default Blogs;
